import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

import ModalState from "./context/modal/ModalState";
import JobState from "./context/jobs/JobsState";

ReactDOM.render(
  <React.StrictMode>
    <ModalState>
      <JobState>
        <App />
      </JobState>
    </ModalState>
  </React.StrictMode>,
  document.getElementById("root")
);
